//Login Screen ಏಕಲ್ ಆರೋಗ್ಯ ಬಳಕೆದಾರ ಹೆಸರು ಗುಪ್ತಪದ ನಿರ್ವಾಹಕ ಗುಪ್ತಪದ ಲಾಗಿನ್ ಮಾಡಿ ಸೈನ್ ಇನ್ ಮಾಡಿ ನಿಮ್ಮ ಯು ಆರ್ ಎಲ್ ಅನ್ನು ಪರಿಶೀಲಿಸಿ. ಬೇರೆ ಪೂರ್ವಪ್ರತ್ಯಯವನ್ನು ಆಯ್ಕೆಮಾಡಿ! ಈ ಬಳಕೆದಾರಹೆಸರು ಅಮಾನ್ಯವಾಗಿದೆ ಈ ಗುಪ್ತಪದ ತುಂಬಾ ಚಿಕ್ಕದಾಗಿದೆ ದಯವಿಟ್ಟು ನಮೂದಿಸಿದ ಬಳಕೆದಾರ ಹೆಸರು ಮತ್ತು ಗುಪ್ತಪದವನ್ನು ಪರಿಶೀಲಿಸಿ ಈ ಜಾಗ ಬೇಕಾಗಿದೆ ನೆಟ್‌ವರ್ಕ್ ದೋಷ ದಯವಿಟ್ಟು ಸ್ಥಳ ಡ್ರಾಪ್‌ಡೌನ್‌ನಿಂದ ಮೌಲ್ಯವನ್ನು ಆಯ್ಕೆಮಾಡಿ ಸ್ಥಳಗಳನ್ನು ತರಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ "ಇಮೇಲ್ ಪೂರ್ಣಗೊಳಿಸುವಿಕೆಗಳನ್ನು ಒದಗಿಸಲು ಸಂಪರ್ಕಗಳ ಅನುಮತಿಗಳ ಅಗತ್ಯವಿದೆ. ಸಾಧನ ಐಡಿ:
ಲಾಗ್ ಇನ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲವೇ? ನಿಮ್ಮ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಮರುಹೊಂದಿಸಲು ದಯವಿಟ್ಟು ನಿಮ್ಮ ಸಿಸ್ಟಂ ನಿರ್ವಾಹಕರನ್ನು ಸಂಪರ್ಕಿಸಿ ಅಥವಾ support@intelehealth.io ಗೆ ಇಮೇಲ್ ಕಳುಹಿಸಿ ನಿಮ್ಮ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಮರುಹೊಂದಿಸಲು ದಯವಿಟ್ಟು ನಿಮ್ಮ ಸಿಸ್ಟಂ ನಿರ್ವಾಹಕರನ್ನು ಸಂಪರ್ಕಿಸಿ
//Home Screen (after login) ಮನೆ ಹೊಸ ರೋಗಿ ರೋಗಿಯನ್ನು ಹುಡುಕಿ ರೋಗನಿರ್ಣಯ ಪರೀಕ್ಷೆಗಳು ಸಕ್ರಿಯ ರೋಗಿಗಳು ಡೇಟಾವನ್ನು ರಿಫ್ರೆಶ್ ಮಾಡಿ ಸಂಯೋಜನೆಗಳು ದಿನದ ಅಂತ್ಯ ಲಾಗ್ ಔಟ್ ಬಳಕೆದಾರರ ಪ್ರೊಫೈಲ್
//Identification Screen ಹೊಸ ರೋಗಿಯನ್ನು ಸೇರಿಸಿ ಮೊದಲ ಹೆಸರು * ಮಧ್ಯದ ಹೆಸರು ಕೊನೆಯ ಹೆಸರು * ವಿಳಾಸ ಸಾಲು 1 ವಿಳಾಸ ಸಾಲು 2 ದೂರವಾಣಿ ಸಂಖ್ಯೆ * ನಿರ್ವಾಹಕ ಗುಪ್ತಪದವನ್ನು ನಮೂದಿಸಿ ಲಿಂಗ * ಪುರುಷ ಹೆಣ್ಣು ಹುಟ್ಟಿದ ದಿನ* ವಯಸ್ಸು: ಸಮಯ: ಗ್ರಾಮ/ಪಟ್ಟಣ/ನಗರ * ರಾಜ್ಯ* ಜಾತಿ ಆರ್ಥಿಕ ಸ್ಥಿತಿ ಶಿಕ್ಷಣ ಮಟ್ಟ ದೇಶ * ಅಂಚೆ ಕೋಡ್ ಮಗ/ಮಗಳು/ಹೆಂಡತಿ ಉದ್ಯೋಗ ರೋಗಿಯನ್ನು ರಚಿಸಲಾಗಿದೆ! ಸರ್ವರ್‌ಗೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ. ದೋಷ: ಡೇಟಾ ಕ್ಷೇತ್ರಗಳನ್ನು ಸರಿಯಾಗಿ ಫಾರ್ಮ್ಯಾಟ್ ಮಾಡಲಾಗಿಲ್ಲ ದಯವಿಟ್ಟು ವರ್ಷಗಳಲ್ಲಿ ವಯಸ್ಸನ್ನು ನಮೂದಿಸಿ ಹುಟ್ಟಿದ ದಿನಾಂಕವನ್ನು ಇಂದಿನ ನಂತರದ ದಿನಾಂಕಕ್ಕೆ ನಿಗದಿಪಡಿಸಲಾಗಿದೆ ಲಿಂಗವನ್ನು ಆಯ್ಕೆ ಮಾಡಲಾಗಿಲ್ಲ ದಯವಿಟ್ಟು ಅಗತ್ಯವಿರುವ ಕ್ಷೇತ್ರಗಳನ್ನು ನಮೂದಿಸಿ ಮಾನ್ಯವಾದ ಹುಟ್ಟಿದ ದಿನವನ್ನು ನಮೂದಿಸಿ ಮಾನ್ಯವಾದ ವಯಸ್ಸನ್ನು ನಮೂದಿಸಿ ವರ್ಷಗಳು ತಿಂಗಳುಗಳು ವರ್ಷಗಳು ಗಂಟೆಗಳು ತಿಂಗಳುಗಳು ನಿಮಿಷಗಳು
