//Patient History Screen ರೋಗಿಯ ಇತಿಹಾಸ ರೋಗಿಯ ಹುಡುಕಾಟ
//Complaint Node Screen ದೂರುಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ ಎಲ್ಲಾ ಪ್ರಶ್ನೆಗಳಿಗೆ ಉತ್ತರಿಸಿ ದೂರುಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ ಆಯ್ದ ವರ್ಗಗಳು: ಆಯ್ದ ದೂರುಗಳು: ಭೇಟಿಗೆ ಕಾರಣ ದೂರು ಆಯ್ಕೆ ಮಾಡಬೇಕು!
//Question Node Screen ಪ್ರಶ್ನೆ ನೋಡ್ ಚಟುವಟಿಕೆ ಮಾರ್ಪಡಿಸಿ ನೀವು ಎಲ್ಲಾ ಪ್ರಶ್ನೆಗಳಿಗೆ ಉತ್ತರಿಸಿರುವಿರಿ ಎಂದು ನಿಮಗೆ ಖಚಿತವಾಗಿದೆಯೇ. ದಯವಿಟ್ಟು ಎಲ್ಲಾ ಸಾಮಾನ್ಯ ಪರೀಕ್ಷೆಯ ಪ್ರಶ್ನೆಗಳಿಗೆ ಉತ್ತರಿಸಿ. ದಯವಿಟ್ಟು ಅವಧಿಯನ್ನು ನಮೂದಿಸಿ ದಯವಿಟ್ಟು ಪಠ್ಯವನ್ನು ನಮೂದಿಸಿ ದಯವಿಟ್ಟು ದಿನಾಂಕವನ್ನು ಆಯ್ಕೆಮಾಡಿ ದಯವಿಟ್ಟು ಸ್ಥಳಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ ದಯವಿಟ್ಟು ಸಂಖ್ಯೆಯನ್ನು ನಮೂದಿಸಿ ದಯವಿಟ್ಟು ಪ್ರದೇಶವನ್ನು ನಮೂದಿಸಿ (ಅಗಲ X ಉದ್ದ) ದಯವಿಟ್ಟು ಶ್ರೇಣಿಯನ್ನು ನಮೂದಿಸಿ ದಯವಿಟ್ಟು ಎಷ್ಟು ಬಾರಿ ನಮೂದಿಸಿ
//Table Exam Screen ವೈಟಲ್ಸ್ ದೇಹದ ಅಳತೆಗಳು ಎತ್ತರ (ಸೆಂ) ತೂಕ (ಕೆಜಿ) ಬಿ ಎಮ್ ಐ ನಾಡಿ (ಬಿಪಿಎಂ) ಪ್ರಮುಖ ಚಿಹ್ನೆಗಳು ಬಿಪಿ ಸಿಸ್ ಬಿಪಿ ದಿಯಾ ತಾಪಮಾನ (C) ಎಸ್ ಪಿ O2 (%) ನಿಮ್ಮ ಎತ್ತರಕ್ಕೆ ಅನುಗುಣವಾಗಿ ನಿಮ್ಮ ತೂಕ ಕಡಿಮೆ ಇರುತ್ತದೆ. ನಿಮ್ಮ ಎತ್ತರಕ್ಕೆ ಅನುಗುಣವಾಗಿ ನಿಮ್ಮ ತೂಕ ಹೆಚ್ಚು ಇರುತ್ತದೆ ನೀವು ವೈದ್ಯರಿಂದ ಟೆಲಿ ಸಮಾಲೋಚನೆಯನ್ನು ಬಯಸುತ್ತೀರಾ? ಉಳಿಸಿ ಹೌದು, ಮುಂದುವರಿಸಿ
ನಿಮ್ಮ ಡಯಾಸ್ಟೊಲಿಕ್ ಬಿಪಿ ಸಾಧಾರಣವಾಗಿಲ್ಲ. ನಿಮ್ಮ ಸಿಸ್ಟೊಲಿಕ್ ಬಿಪಿ ಸಾಮಾನ್ಯವಾಗಿಲ್ಲ. ನಿಮ್ಮ ಎಸ್ ಪಿ O2 ಸಾಧಾರಣವಾಗಿಲ್ಲ. ನಿಮ್ಮ ನಾಡಿಮಿಡಿತ ಸಾಧಾರಣವಾಗಿಲ್ಲ. ನಿಮ್ಮ ಉಸಿರಾಟದ ದರವು ಸಾಮಾನ್ಯವಾಗಿಲ್ಲ. ನಿಮ್ಮ ತಾಪಮಾನವು ಸಾಧಾರಣವಾಗಿಲ್ಲ. ನಿಮ್ಮ ಎಚ್ ಜಿ ಬಿ ಸಾಮಾನ್ಯವಾಗಿಲ್ಲ. ನಿಮ್ಮ ಶುಗರ್ ರಾಂಡಮ್ ಮಟ್ಟವು ಸಾಮಾನ್ಯವಲ್ಲ. ನಿಮ್ಮ ಶುಗರ್ ಫಾಸ್ಟಿಂಗ್ ಮಟ್ಟವು ಸಾಧಾರಣವಾಗಿಲ್ಲ. ಊಟದ ನಂತರದ ನಿಮ್ಮ ಸಕ್ಕರೆ ಮಟ್ಟವು ಸಾಮಾನ್ಯವಲ್ಲ. ಸಲ್ಲಿಸಲು ಕನಿಷ್ಠ ಒಂದು ನಮೂದು ಅಗತ್ಯವಿದೆ
//Patient Search Screen ಹೆಸರಿನ ಮೂಲಕ ರೋಗಿಯನ್ನು ಹುಡುಕಲು ಟೈಪ್ ಮಾಡಿ... ಹುಡುಕಿ ದಯವಿಟ್ಟು ಬಳಕೆದಾರಹೆಸರು ಮತ್ತು ಪಾಸ್‌ವರ್ಡ್ ನಮೂದಿಸಿರುವುದನ್ನು ಪರಿಶೀಲಿಸಿ
//Past Medical History Screen ಹಿಂದಿನ ವೈದ್ಯಕೀಯ ಇತಿಹಾಸ
//Visit Summary Screen ಕುಟುಂಬದ ಇತಿಹಾಸ ಶಾರೀರಿಕ ಪರೀಕ್ಷೆ ಸಾರಾಂಶವನ್ನು ಭೇಟಿ ಮಾಡಿ ತಾಪಮಾನ(C) ಎಸ್ ಪಿ O2 (%) ಸಿ ಎಚ್ ಡಬ್ಲೂ ಆನ್ ಡ್ಯೂಟಿ ವೈಟಲ್ಸ್ ಎತ್ತರ (ಸೆಂ) ತೂಕ (ಕೆಜಿ) ಬಿ ಎಮ್ ಐ ಬಿಪಿ ನಾಡಿ ಹಿಂದಿನ ವರದಿಗಳು ವೈದ್ಯಕೀಯ ಇತಿಹಾಸ ಕುಟುಂಬದ ಇತಿಹಾಸ ಪರೀಕ್ಷೆಯಲ್ಲಿ ಭೇಟಿಗೆ ಕಾರಣ ವೈಟಲ್ಸ್ ವೈದ್ಯರ ವಿವರಗಳು ಸೂಚಿಸಿದ ಔಷಧಿಗಳು ರೋಗನಿರ್ಣಯ ವೈದ್ಯಕೀಯ ಸಲಹೆ ಪರೀಕ್ಷೆಗಳು/ಉಲ್ಲೇಖಗಳು ಹೆಚ್ಚುವರಿ ಪ್ರತಿಕ್ರಿಯೆಗಳು ಹೆಸರು ಐಡಿ ಡೌನ್‌ಲೋಡ್ ಮಾಡಿ ಅಪ್ಲೋಡ್ ಮಾಡಿ button_download ದಿನಾಂಕವನ್ನು ಅನುಸರಿಸಿ ದಯವಿಟ್ಟು ರೋಗಿಗೆ ಅವರ ಮುಂದಿನ ದಿನಾಂಕವನ್ನು ನೆನಪಿಸಿ: ಭೇಟಿಯನ್ನು ಕೊನೆಗೊಳಿಸಲು ಪ್ರಯತ್ನಿಸುವ ಮೊದಲು ದಯವಿಟ್ಟು ಮೊದಲು ಅಪ್‌ಲೋಡ್ ಮಾಡಿ.
