//Patient Detail Screen ರೋಗಿಯ ಮಾಹಿತಿ ರೋಗಿಯ ಇತಿಹಾಸ ರೋಗಿಯ ವಿವರ ಇತಿಹಾಸ ವೈದ್ಯರ ಹೊಸ ಸಲಹೆಯನ್ನು ಪ್ರಾರಂಭಿಸಿ ಸೇವಿಕಾ ಹೊಸ ಸಲಹೆಯನ್ನು ಪ್ರಾರಂಭಿಸಿ ಹಿಂದಿನ ಭೇಟಿಗಳು ವೈದ್ಯಕೀಯ ಇತಿಹಾಸ ಕುಟುಂಬದ ಇತಿಹಾಸ ಅನಾರೋಗ್ಯದ ಇತಿಹಾಸವಿಲ್ಲ ರೋಗಿಯ ಐಡಿ ಹುಟ್ಟಿದ ದಿನಾಂಕ ವಯಸ್ಸು ವಿಳಾಸ ದೂರವಾಣಿ ಸಂಖ್ಯೆ ಭೇಟಿ ತೆರೆಯಲು ಕ್ಲಿಕ್ ಮಾಡಿ ಸಂಯೋಜನೆಗಳು
ಸಾಮಾನ್ಯ
ಸಾಮಾಜಿಕ ಶಿಫಾರಸುಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ ನಿಮ್ಮ ಸಂದೇಶ ಇತಿಹಾಸ ಆಧರಿಸಿ ಸಂಪರ್ಕಿಸಲು ಜನರಿಗೆ ಶಿಫಾರಸುಗಳು
ಪ್ರದರ್ಶನ ಹೆಸರು ಜಾನ್ ಸ್ಮಿತ್
ಡೇಟಾ ಮತ್ತು ರಿಫ್ರೆಶ್
ಸರ್ವರ್ ಯು ಆರ್ ಎಲ್ ಸ್ಥಳ ಪೂರ್ವಪ್ರತ್ಯಯ
ಅಧಿಸೂಚನೆಗಳು ಹೊಸ ಸಂದೇಶ ಅಧಿಸೂಚನೆಗಳು ರಿಂಗ್ಟೋನ್ ಮೂಕ ವೈಬ್ರೇಟ್ ಅಪ್ಲಿಕೇಶನ್ ದೋಷ ಎದುರಾಗಿದೆ; ವರದಿ ಕಳುಹಿಸಲಾಗಿದೆ
ಸೆಟಪ್ ಲಾಗಿನ್ ದೋಷ ಯುಆರ್ ಎಲ್ ಅನ್ನು ನಮೂದಿಸಿ
ಕ್ಯಾಮೆರಾ ಇಂದಿನ ಭೇಟಿಗಳು ಹೆಚ್ಚುವರಿ ದಾಖಲೆಗಳು ವೀಡಿಯೊ ಲೈಬ್ರರಿ ವಿವರಗಳನ್ನು ಭೇಟಿ ಮಾಡಿ
ಸೆಟಪ್ ಮಾಡಲು ಬಲವಾದ ಇಂಟರ್ನೆಟ್ ಸಂಪರ್ಕದ ಅಗತ್ಯವಿದೆ. ಹಸ್ತಚಾಲಿತ ಪ್ರವೇಶ ಅಳಿಸಿ ಮತ್ತು ಮರು-ಮಾಡು ನೀವು ವೈಟಲ್ಸ್ ಸ್ಕ್ರೀನ್‌ನಿಂದ ವೈಟಲ್‌ಗಳನ್ನು ಮರು-ಮಾಡಬಹುದು
//Camera Permissions ಕ್ಯಾಮರಾ ಪೂರ್ವವೀಕ್ಷಣೆ ತೋರಿಸಲು ಕ್ಯಾಮರಾ ಅನುಮತಿ ಅಗತ್ಯವಿದೆ. ಕ್ಯಾಮರಾ ಅನುಮತಿಯನ್ನು ನಿರಾಕರಿಸಲಾಗಿದೆ. ಕ್ಯಾಮರಾವನ್ನು ಪ್ರವೇಶಿಸಲು ದಯವಿಟ್ಟು ಅದನ್ನು ನೀಡಲು ಪರಿಗಣಿಸಿ! ಕ್ಯಾಮರಾ ಅನುಮತಿಯನ್ನು ಮತ್ತೆ ಕೇಳದೆ ನಿರಾಕರಿಸಲಾಗಿದೆ. ಅನುಮತಿಸಿ ನಿರಾಕರಿಸು ಸರಿ ರದ್ದುಮಾಡು ಚಿತ್ರ ತೆಗೆಯಲಾಗಿದೆ ಫ್ಲಾಶ್ ಬದಲಿಸಿ ಕ್ಯಾಮರಾ ಬದಲಿಸಿ ಫ್ಲಾಶ್ ಸ್ವಯಂ ಫ್ಲ್ಯಾಶ್ ಆಫ್ ಫ್ಲ್ಯಾಶ್ ಆನ್
//SEND SMS Permissions ಎಸ್ ಎಮ್ ಎಸ್ ಕಳುಹಿಸಲು ಎಸ್ ಎಮ್ ಎಸ್ ಅನುಮತಿ ಅಗತ್ಯವಿದೆ. ಎಸ್ ಎಮ್ ಎಸ್ ಅನುಮತಿಯನ್ನು ನಿರಾಕರಿಸಲಾಗಿದೆ. ಅಪ್ಲಿಕೇಶನ್‌ನಿಂದ ಎಸ್ ಎಮ್ ಎಸ್ ಕಳುಹಿಸಲು ದಯವಿಟ್ಟು ಅದನ್ನು ನೀಡುವುದನ್ನು ಪರಿಗಣಿಸಿ! ಮತ್ತೆಂದೂ ಕೇಳದಿರುವಂತೆ ಎಸ್ ಎಮ್ ಎಸ್ ಅನುಮತಿಯನ್ನು ನಿರಾಕರಿಸಲಾಗಿದೆ.
ಉಳಿಸಿ ಅಳಿಸಿ
//Camera Dialog ದಯವಿಟ್ಟು ಉತ್ತಮ ಬೆಳಕಿನ ಸ್ಥಿತಿಯಲ್ಲಿ ಮಾತ್ರ ಡಾಕ್ಯುಮೆಂಟ್ ಫೋಟೋ ಕ್ಲಿಕ್ ಮಾಡಿ. ಡಾಕ್ಯುಮೆಂಟ್ ಫೋಟೋ ಸ್ಪಷ್ಟವಾಗಿಲ್ಲದಿದ್ದರೆ, ದಯವಿಟ್ಟು ಡಾಕ್ಯುಮೆಂಟ್ ಫೋಟೋವನ್ನು ರೀಟೇಕ್ ಮಾಡಿ.
ಆಫ್‌ಲೈನ್ ಲಾಗಿನ್ ಲಭ್ಯವಿಲ್ಲ. ಬಳಕೆದಾರರು ಹೊಂದಿಕೆಯಾಗುತ್ತಿಲ್ಲ. ಆಫ್‌ಲೈನ್‌ನಲ್ಲಿ ಪ್ರಮಾಣೀಕರಿಸಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ. ಪ್ರಮಾಣೀಕರಿಸಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ.
ಸ್ಥಳವನ್ನು ಆಯ್ಕೆಮಾಡಿ ಪರವಾನಗಿ ಕೀಲಿ ಡೆಮೊ ಪ್ರೋಟೋಕಾಲ್‌ಗಳನ್ನು ಬಳಸಿ ಪ್ರೋಟೋಕಾಲ್‌ಗಳನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಿ
ದಯಮಾಡಿ ನಿರೀಕ್ಷಿಸಿ ಪ್ರೋಟೋಕಾಲ್‌ಗಳನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಲಾಗಿನ್ ಆಗುತ್ತಿದೆ ಮೈಂಡ್ ಮ್ಯಾಪ್‌ಗಳನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡುವಲ್ಲಿ ದೋಷ
//Sync strings ನಿಲ್ಲಿಸಿದ ಪ್ರಗತಿಯಲ್ಲಿದೆ ಸಂಪೂರ್ಣ ದೋಷ: ಅಂತಹ ಸ್ಥಿತಿ ಇಲ್ಲ
ಐಡಿ ಸಂಖ್ಯೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ...
ಭೇಟಿ ನವೀಕರಣಕ್ಕೆ ಭೇಟಿ ನೀಡಿ ರೋಗಿ ರೋಗಿಯ ನವೀಕರಣ ರೋಗಿಯ ಪ್ರೊಫೈಲ್ ಚಿತ್ರ ಚಿತ್ರಗಳನ್ನು ಭೇಟಿ ಮಾಡಿ ಪ್ರಿಸ್ಕ್ರಿಪ್ಷನ್
ಭೇಟಿಯನ್ನು ಕೊನೆಗೊಳಿಸಲು ಪ್ರಯತ್ನಿಸುವ ಮೊದಲು ದಯವಿಟ್ಟು ಮೊದಲು ಡೌನ್‌ಲೋಡ್ ಮಾಡಿ. ಫೋನ್ ಸಂಖ್ಯೆ ಖಾಲಿ ಇರುವಂತಿಲ್ಲ ಭೇಟಿಯನ್ನು ಕೊನೆಗೊಳಿಸಿ
ಎಸ್ ಎಮ್ ಎಸ್ ವಿಫಲವಾಗಿದೆ, ದಯವಿಟ್ಟು ನಂತರ ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ! ಎಸ್ ಎಮ್ ಎಸ್ ಕಳುಹಿಸಲಾಗಿದೆ!
ನೀವು ವಿವರಗಳನ್ನು ನವೀಕರಿಸಲು ಬಯಸುವಿರಾ?
ಬ್ಯಾಕಪ್ ಪೂರ್ಣಗೊಂಡಿದೆ!
ಮರೆಮಾಡಿ ತೋರಿಸು
ಹೊಸ ರೋಗಿ ರೋಗಿಗಳನ್ನು ಹುಡುಕಿ ವೀಡಿಯೊ ಲೈಬ್ರರಿ
ಈ ವೈಶಿಷ್ಟ್ಯವು ಎಸ್ ಡಿ ಕಾರ್ಡ್‌ಗಳನ್ನು ಹೊಂದಿರುವ ಸಾಧನಗಳಿಗೆ ಮಾತ್ರ ಲಭ್ಯವಿರುತ್ತದೆ. ನಿರ್ವಾಹಕರ ಪಾಸ್‌ವರ್ಡ್ ತಪ್ಪಾಗಿದೆ ಈ ಡೈರೆಕ್ಟರಿಯಲ್ಲಿ ಯಾವುದೇ ಫೈಲ್‌ಗಳಿಲ್ಲ ಕ್ಯಾಮರಾ ಅಳವಡಿಸಿಲ್ಲ. ಅಳಿಸುವಲ್ಲಿ ದೋಷ ಆಫ್‌ಲೈನ್ ಲಾಗಿನ್ ವಿಫಲವಾಗಿದೆ ಆಫ್‌ಲೈನ್ ಲಾಗಿನ್ ಯಶಸ್ವಿಯಾಗಿದೆ ಆಫ್‌ಲೈನ್ ಲಾಗಿನ್ ಅಮಾನ್ಯವಾಗಿದೆ
ರೋಗಿಯನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗಿಲ್ಲ ರೋಗಿಯನ್ನು ನೋಂದಾಯಿಸಲಾಗಿಲ್ಲ
