ಒದಗಿಸಿಲ್ಲ
ನಿಮ್ಮ ಅನುಭವ ಹೇಗಿತ್ತು? ನಿಮ್ಮ ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಇಲ್ಲಿ ನಮೂದಿಸಿ ಬಿಟ್ಟುಬಿಡಿ ಸಲ್ಲಿಸು ಸಲ್ಲಿಸುವ ಮೊದಲು ದಯವಿಟ್ಟು ಸ್ಮೈಲಿ ಆಯ್ಕೆಮಾಡಿ
ಡೇಟಾಬೇಸ್ ಬ್ಯಾಕಪ್ ಪೂರ್ಣಗೊಂಡಿದೆ! ಡೇಟಾಬೇಸ್ ಮರುಸ್ಥಾಪನೆ ಪೂರ್ಣಗೊಂಡಿದೆ!
ಡೇಟಾಬೇಸ್ ಅನ್ನು ಕ್ಲೌಡ್‌ಗೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಇಂಟರ್ನೆಟ್ ಸಂಪರ್ಕ ಲಭ್ಯವಿಲ್ಲ ಬ್ಯಾಕಪ್ ಮಾಡಲು ಯಾವುದೇ ಡೇಟಾ ಇಲ್ಲ! ಸ್ಥಳೀಯ ಬ್ಯಾಕಪ್ ಲಭ್ಯವಿಲ್ಲ ಸ್ಥಳೀಯ ಬ್ಯಾಕಪ್‌ನಿಂದ ಮರುಸ್ಥಾಪಿಸಲಾಗುತ್ತಿದೆ
ಫಾರ್ಮ್ ಕ್ಲೌಡ್ ಅನ್ನು ಮರುಸ್ಥಾಪಿಸಿ ಡೇಟಾವನ್ನು ಮರುಸ್ಥಾಪಿಸಲಾಗುತ್ತಿದೆ ಡೇಟಾಬೇಸ್ ಡೇಟಾವನ್ನು ಒಳಗೊಂಡಿದೆ, ಪುನಃಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ! ಕ್ಲೌಡ್‌ನಿಂದ ಡೇಟಾಬೇಸ್ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ
ಕ್ಲೌಡ್‌ನಿಂದ ಡೇಟಾವನ್ನು ಮರುಸ್ಥಾಪಿಸಲಾಗುತ್ತಿದೆ (ಬಲವಂತವಾಗಿ)
ಡೇಟಾಬೇಸ್ ಅಪ್ಲೋಡ್ ಡೇಟಾಬೇಸ್ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಡೇಟಾಬೇಸ್ ಅಪ್‌ಲೋಡ್ ಪೂರ್ಣಗೊಂಡಿದೆ ಡೇಟಾಬೇಸ್ ಅಪ್‌ಲೋಡ್ ವಿಫಲವಾಗಿದೆ
ಡೇಟಾಬೇಸ್ ಬ್ಯಾಕಪ್ ಲಭ್ಯವಿಲ್ಲ ಬ್ಯಾಕಪ್ ಫೈಲ್ ಬರೆಯುವಲ್ಲಿ ದೋಷ
ಬ್ಯಾಕಪ್ ಅನ್ನು ಮರುಸ್ಥಾಪಿಸಿ ಸ್ಥಳೀಯ ಬ್ಯಾಕಪ್ ಕಂಡುಬಂದಿದೆ. ನೀವು ಮರುಸ್ಥಾಪಿಸಲು ಬಯಸುವಿರಾ?
ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಚಿತ್ರದ ಡೇಟಾವನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಚಿತ್ರದ ಡೇಟಾ ಡೌನ್‌ಲೋಡ್ ಪೂರ್ಣಗೊಂಡಿದೆ ಎಲ್ಲಾ ಇಮೇಜ್ ಫೈಲ್‌ಗಳನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ ಚಿತ್ರ ಲಭ್ಯವಿಲ್ಲ ಚಿತ್ರ ಡೌನ್‌ಲೋಡ್ ವಿಫಲವಾಗಿದೆ
ಈಗಾಗಲೇ ಲಾಗ್ ಇನ್ ಆಗಿದೆ! ಈಗಾಗಲೇ ಲಾಗ್ ಇನ್ ಆಗಿದೆ.ದಯವಿಟ್ಟು ಇತರ ಸಾಧನದಿಂದ ಲಾಗ್‌ಔಟ್ ಮಾಡಿ. ಸರ್ವರ್‌ನಿಂದ ಲಾಗ್ ಔಟ್ ಮಾಡಲಾಗಿದೆ ಲಾಗಿನ್ ಯಶಸ್ವಿಯಾಗಿದೆ! ಮತ್ತೊಬ್ಬ ಬಳಕೆದಾರರು ಈ ಸ್ಥಳಕ್ಕೆ ಲಾಗ್ ಇನ್ ಆಗಿದ್ದಾರೆ. ದಯವಿಟ್ಟು ನಿರ್ವಾಹಕರನ್ನು ಸಂಪರ್ಕಿಸಿ ಸಾಧನ ಆಫ್‌ಲೈನ್. ಲಾಗಿನ್ ಪರಿಶೀಲನೆಗಾಗಿ ಸರ್ವರ್ ಅನ್ನು ಪರಿಶೀಲಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ
ಸ್ಪ್ಲಾಶ್ ಆಕ್ಟಿಸಿಟಿ ಮನೆಯ ಚಟುವಟಿಕೆ ಚಟುವಟಿಕೆ ರಿಫ್ರೆಶ್ ಗೌಪ್ಯತೆ ಸೂಚನೆ ಸಾರಾಂಶ ಚಟುವಟಿಕೆಗೆ ಭೇಟಿ ನೀಡಿ ಹಿಂದಿನ ವೈದ್ಯಕೀಯ ಇತಿಹಾಸ ಚಟುವಟಿಕೆ ರೋಗಿಯ ಸಮೀಕ್ಷೆ ಚಟುವಟಿಕೆ
ದಯವಿಟ್ಟು ಒಂದು ಆಯ್ಕೆಯನ್ನು ಆರಿಸಿ ತಾಪಮಾನ (ಎಫ್) ಈಗ ರಿಫ್ರೆಶ್ ಮಾಡಿ ಕೊನೆಯ ಸಿಂಕ್ ನಿಮ್ಮ ಗುಪ್ತಪದವನ್ನು ನಮೂದಿಸಿ ನಿಮ್ಮ ಬಳಕೆದಾರ ಹೆಸರು ನಮೂದಿಸಿ ರೋಗಿಯು ನಿರಾಕರಿಸುತ್ತಾನೆ ರೋಗಿಯ ವರದಿಗಳು
ಸಂಬಂಧಿತ ರೋಗಲಕ್ಷಣಗಳು ಸರ್ವರ್ ಯು ಆರ್ ಎಲ್ ಅನ್ನು ನಮೂದಿಸಿ ಪರವಾನಗಿ ಕೀಲಿಯನ್ನು ನಮೂದಿಸಿ ಅಮಾನ್ಯ ಯು ಆರ್ ಎಲ್ ವರ್ಷಗಳು ತಿಂಗಳುಗಳು ರಿಫ್ರೆಶ್ ಪೂರ್ಣಗೊಳ್ಳುವವರೆಗೆ ದಯವಿಟ್ಟು ನಿರೀಕ್ಷಿಸಿ ರೋಗಿಯ ಹೆಸರು ಮಗ/ಮಗಳು/ಹೆಂಡತಿ ಉದ್ಯೋಗ ಆರ್ಥಿಕ ಸ್ಥಿತಿ ಶಿಕ್ಷಣ ಮಟ್ಟ ಜಾತಿ ಹಿಂದಿನ ಭೇಟಿಗಳು ಒಪ್ಪಿಕೊಳ್ಳಿ ತಿರಸ್ಕರಿಸಿ ಮುಂದೆ ನೀವು ಯಾವ ಸರ್ವರ್‌ಗೆ ಸಂಪರ್ಕಿಸಲು ಬಯಸುತ್ತೀರಿ? ಯು ಆರ್ ಎಲ್ ನಮೂದಿಸಿ ಲಾಗಿನ್ ಮಾಡಲು ಸ್ಥಳವನ್ನು ಆಯ್ಕೆಮಾಡಿ ಪ್ರೋಟೋಕಾಲ್‌ಗಳಿಗಾಗಿ ಆಯ್ಕೆಯನ್ನು ಆರಿಸಿ ದಯವಿಟ್ಟು ನಿಮ್ಮ ಬಳಕೆದಾರಹೆಸರು ಮತ್ತು ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ನಮೂದಿಸಿ ಆಂಡ್ರಾಯ್ಡ್ ಐಡಿ: ಉಸಿರಾಟದ ದರ ಚಿತ್ರಗಳನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಲು ಕ್ಲಿಕ್ ಮಾಡಿ ವೈದ್ಯರ ವಿವರಗಳು ಆರೋಗ್ಯ ಕಾರ್ಯಕರ್ತ ಆದ್ಯತೆ ಸರ್ವರ್ ಯು ಆರ್ ಎಲ್ ರಿಫ್ರೆಶ್ ಮಾಡಿ ಪ್ರೋಟೋಕಾಲ್‌ಗಳನ್ನು ನವೀಕರಿಸಿ ಎಲ್ಲಾ ಭೇಟಿಯನ್ನು ಕೊನೆಗೊಳಿಸಿ ಸೃಷ್ಟಿಕರ್ತರಿಂದ ಫಿಲ್ಟರ್ ಮಾಡಿ ಗ್ರಹದ ಹೆಸರು ಸರಿ ರದ್ದುಮಾಡು ಮುಗಿಸಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ ಭೇಟಿಗಳು. ಭೇಟಿಯನ್ನು ಕೊನೆಗೊಳಿಸಲು ಪ್ರಯತ್ನಿಸುವ ಮೊದಲು ಭೇಟಿಯನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಿ. ಸಕ್ರಿಯ ಮುಚ್ಚಲಾಗಿದೆ
ರಿಫ್ರೆಶ್ ಪ್ರಗತಿಯಲ್ಲಿದೆ ದಯಮಾಡಿ ನಿರೀಕ್ಷಿಸಿ... ರಿಫ್ರೆಶ್ ಮಾಡಿ ರಿಫ್ರೆಶ್ ಹಿನ್ನೆಲೆ ಪೂರ್ಣಗೊಂಡಿದೆ ರಿಫ್ರೆಶ್ ಲಭ್ಯವಿಲ್ಲ ದಯವಿಟ್ಟು ಇಂಟರ್ನೆಟ್ ಸಂಪರ್ಕಕ್ಕೆ ಸಂಪರ್ಕಪಡಿಸಿ! ಇಮೇಜ್ ಅಪ್ಲೋಡ್ ಇಮೇಜ್ ಅಪ್ಲೋಡ್ ವಿಫಲವಾಗಿದೆ ನೀನು ನಿಜವಾಗಲೂ ಹೊರಗೆ ಹೋಗಬಯಸುತ್ತೀಯಾ? ನೀವು ಲಾಗ್‌ಔಟ್ ಮಾಡಲು ಖಚಿತವಾಗಿ ಬಯಸುವಿರಾ? ಕೊನೆಯ ರಿಫ್ರೆಶ್ ರೋಗಿಯನ್ನು ನವೀಕರಿಸಿ ನೀವು ಹಿಂತಿರುಗಲು ಖಚಿತವಾಗಿ ಬಯಸುವಿರಾ? ದೋಷ ರೋಗಿಯ ಡೇಟಾ ಅಪ್ಲೋಡ್ ರೋಗಿಯ ಚಿತ್ರ ಡೌನ್‌ಲೋಡ್ \'s ಇಮೇಜ್ ಡೌನ್‌ಲೋಡ್ ಪೂರ್ಣಗೊಂಡಿದೆ. ಯಾವುದೇ ಪೂರ್ವ ಭೇಟಿಗಳಿಲ್ಲ. ಭೇಟಿಯನ್ನು ಕೊನೆಗೊಳಿಸಿ ಭೇಟಿ ಮುಗಿಯಿತು ಈ ಪ್ರಶ್ನೆಗೆ ಒಂದೇ ಉತ್ತರವಿರಬಹುದು. ವೈದ್ಯರಿಗೆ ಅಪ್ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ. ಡೇಟಾ ಅಪ್‌ಲೋಡ್‌ಗೆ ಭೇಟಿ ನೀಡಿ ಭೇಟಿ ಡೇಟಾವನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಭೇಟಿ ಡೇಟಾವನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ವಿಫಲವಾಗಿದೆ ಅಪ್‌ಲೋಡ್ ಪೂರ್ಣಗೊಂಡಿದೆ ನಿಮ್ಮ ಸಂಪರ್ಕವನ್ನು ಪರಿಶೀಲಿಸಿ ವೈದ್ಯರಿಂದ ಡೌನ್ಲೋಡ್ ಮಾಡಿ ಪ್ರಿಸ್ಕ್ರಿಪ್ಷನ್ ಅನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ ಪ್ರಿಸ್ಕ್ರಿಪ್ಷನ್ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಭೇಟಿ ಡೇಟಾ ವಿಫಲವಾಗಿದೆ ರೋಗಿಯ ಡೇಟಾ ವಿಫಲವಾಗಿದೆ ಗೌಪ್ಯತೆ ಸೂಚನೆ ಈ ಆರೋಗ್ಯ ಕಾರ್ಯಕರ್ತರಿಗೆ ಯಾವುದೇ ರೋಗಿಗಳ ದಾಖಲೆಗಳು ಕಂಡುಬಂದಿಲ್ಲ. ರಿಫ್ರೆಶ್ ಯಶಸ್ವಿಯಾಗಿ ರಿಫ್ರೆಶ್ ಮಾಡಲಾಗಿದೆ ಭಾಷೆಗಳು ಪ್ರಸ್ತುತ ಭಾಷೆ
