ಮುದ್ರಿಸಿ ರಿಫ್ರೆಶ್ ಮಾಡಿ ಕುಟುಂಬ ಸದಸ್ಯ ಯಾವುದೇ ಕುಟುಂಬ ಸದಸ್ಯರನ್ನು ನೋಂದಾಯಿಸಲಾಗಿಲ್ಲ "ಡಾಕ್ಯುಮೆಂಟ್ - " ಲಿಂಗ ನೀವು ಕುಟುಂಬದ ಮುಖ್ಯಸ್ಥರಾಗಿದ್ದೀರಾ?* ನಿನ್ನ ವೃತ್ತಿ ಏನು?* ನಿಮ್ಮ ಬಳಿ ಬ್ಯಾಂಕ್ ಖಾತೆ ಇದೆಯೇ?* ನೀವು ವೈಯಕ್ತಿಕವಾಗಿ ಯಾವ ರೀತಿಯ ಮೊಬೈಲ್ ಫೋನ್ ಹೊಂದಿದ್ದೀರಿ?* ಫೋನ್ ಮಾಲೀಕತ್ವ* ನೀವು ಅಥವಾ ನಿಮ್ಮ ಕುಟುಂಬದ ಯಾರಾದರೂ ವಾಟ್ಸಪ್ ಬಳಸುತ್ತೀರಾ?* ಮನೆಯಲ್ಲಿರುವ ಒಟ್ಟು ಸದಸ್ಯರ ಸಂಖ್ಯೆ* ಸಂಖ್ಯೆಯನ್ನು ನಮೂದಿಸಿ ನಿಮ್ಮ ಮನೆಯಲ್ಲಿ ಸಾಮಾನ್ಯವಾಗಿ ಎಷ್ಟು ಸದಸ್ಯರು ವಾಸಿಸುತ್ತಿದ್ದಾರೆ ಅಥವಾ ಈಗ ನಿಮ್ಮೊಂದಿಗೆ ಇದ್ದಾರೆ* ನಿಮ್ಮ ಮನೆಯ ಸದಸ್ಯರಿಗೆ ಕುಡಿಯುವ ನೀರಿನ ಮುಖ್ಯ ಮೂಲ ಯಾವುದು?* ಕುಡಿಯುವ ನೀರನ್ನು ಸುರಕ್ಷಿತಗೊಳಿಸಲು ಏನು ಮಾಡುತ್ತೀರಿ?* ಅಲ್ಲಿಗೆ ಹೋಗಿ, ನೀರು ತೆಗೆದುಕೊಂಡು, ಒಂದೇ ಟ್ರಿಪ್‌ನಲ್ಲಿ ಹಿಂತಿರುಗಲು ಎಷ್ಟು ಸಮಯ ತೆಗೆದುಕೊಳ್ಳುತ್ತದೆ?* ಉತ್ತರಿಸಲು ನಿರಾಕರಿಸಿದರು ಸಮಯವನ್ನು ನಮೂದಿಸಿ ಕಳೆದ ಎರಡು ವಾರಗಳಲ್ಲಿ, ಕನಿಷ್ಠ ಒಂದು ದಿನವಾದರೂ ಈ ಮೂಲದಿಂದ ನೀರು ಲಭ್ಯವಾಗಲಿಲ್ಲವೇ?* ನಿಮ್ಮ ಮನೆಯ ಸದಸ್ಯರು ಸಾಮಾನ್ಯವಾಗಿ ಯಾವ ರೀತಿಯ ಶೌಚಾಲಯ ಸೌಲಭ್ಯವನ್ನು ಬಳಸುತ್ತಾರೆ?* ಮನೆಯ ರಚನೆಯನ್ನು ಆಯ್ಕೆಮಾಡಿ* ನಿಮ್ಮ ಕುಟುಂಬವು ಎಷ್ಟು ಹೆಕ್ಟೇರ್ ಕೃಷಿಯೋಗ್ಯ ಭೂಮಿಯನ್ನು ಹೊಂದಿದೆ?* ಉತ್ತರವನ್ನು ನಮೂದಿಸಿ ಉದ್ಯೋಗವನ್ನು ನಮೂದಿಸಿ ಆಯ್ಕೆ ಮಾಡಿ ನಿಮಿಷಗಳು ಗಂಟೆಗಳು ದಿನಗಳು ವಾರಗಳು ತಿಂಗಳುಗಳು ವರ್ಷಗಳು ಚಿತ್ರವನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಉಳಿಸಲಾಗಿದೆ! ನೀವು ಈ ಭೇಟಿಯನ್ನು ತುರ್ತು ಪರಿಸ್ಥಿತಿ ಎಂದು ಹೊಂದಿಸಲು ಬಯಸುವಿರಾ? ಪ್ರತಿ ಗಂಟೆಗೆ ಪ್ರತಿ ದಿನಕ್ಕೆ ವಾರಕ್ಕೆ ಪ್ರತಿ ತಿಂಗಳು ವರ್ಷಕ್ಕೆ
ವಿಫಲವಾದ ರಿಫ್ರೆಶ್, ನಿಮ್ಮ ಇಂಟರ್ನೆಟ್ ಸಂಪರ್ಕವನ್ನು ಪರಿಶೀಲಿಸಿ. ದಯವಿಟ್ಟು ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ಮರುಪ್ರಾರಂಭಿಸಿ. ಏನೋ ತಪ್ಪಾಗಿದೆ. ದಯವಿಟ್ಟು ಬೆಂಬಲವನ್ನು ಸಂಪರ್ಕಿಸಿ ನೀವು ಕೋವಿಡ್ ಲಸಿಕೆ ತೆಗೆದುಕೊಂಡಿದ್ದೀರಾ?* ವ್ಯಾಕ್ಸಿನೇಷನ್ ಆಯ್ಕೆಯನ್ನು ಆರಿಸಿ ದಯವಿಟ್ಟು ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಗೆ ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ನವೀಕರಿಸಿ.
