ಪುಸ್ತಕ ನೇಮಕಾತಿ ನೇಮಕಾತಿಯನ್ನು ಮರುಹೊಂದಿಸಿ ಈ ಸ್ಲಾಟ್ ಅನ್ನು ಬುಕ್ ಮಾಡಲು ನೀವು ಖಚಿತವಾಗಿ ಬಯಸುವಿರಾ? ಅಪಾಯಿಂಟ್‌ಮೆಂಟ್ ರದ್ದುಗೊಳಿಸಲು ನೀವು ಖಚಿತವಾಗಿರುವಿರಾ? ನೇಮಕಾತಿ ರದ್ದುಗೊಳಿಸಿ ಆಯ್ಕೆ ಮಾಡಿದ ದಿನಾಂಕ ಮತ್ತು ವಿಶೇಷತೆಗಾಗಿ ನೇಮಕಾತಿ ಸ್ಲಾಟ್ ಲಭ್ಯವಿಲ್ಲ! ನೀವು ಯಾವುದೇ ಅಪಾಯಿಂಟ್‌ಮೆಂಟ್ ಹೊಂದಿಲ್ಲ! ನೇಮಕಾತಿ ಪಟ್ಟಿ ನೇಮಕಾತಿ ಬುಕಿಂಗ್ ನೇಮಕಾತಿಗಾಗಿ ದಯವಿಟ್ಟು ನೇಮಕಾತಿ ಸ್ಲಾಟ್ ಆಯ್ಕೆಮಾಡಿ ದಯವಿಟ್ಟು ವಿಶೇಷತೆಯನ್ನು ಆಯ್ಕೆಮಾಡಿ! ವಿಶೇಷತೆ
ವೈದ್ಯರ ನೇಮಕಾತಿಗಳು ಸ್ಲಾಟ್ ಮಾಹಿತಿ ನೇಮಕಾತಿ ಕಾಯ್ದಿರಿಸಲಾಗಿದೆ ನಿಮಿಷಗಳು ಬುಕ್ ಮಾಡಿದೆ ರದ್ದುಗೊಳಿಸಲಾಗಿದೆ ಅಪಾಯಿಂಟ್‌ಮೆಂಟ್ ಕಾಯ್ದಿರಿಸುವ ಮೊದಲು ದಯವಿಟ್ಟು ಭೇಟಿಯನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಿ. ಆದ್ಯತೆಯ ಭೇಟಿಗಾಗಿ ಅಪಾಯಿಂಟ್‌ಮೆಂಟ್ ಬುಕಿಂಗ್ ಲಭ್ಯವಿಲ್ಲ ನೇಮಕಾತಿಯನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಕಾಯ್ದಿರಿಸಲಾಗಿದೆ! ಗೊತ್ತುಪಡಿಸಿದ ನೇಮಕಾತಿ ವಿಫಲವಾಗಿದೆ! ನೇಮಕಾತಿ ರದ್ದುಗೊಳಿಸಲು ವಿಫಲವಾಗಿದೆ! ನೇಮಕಾತಿಯನ್ನು ಯಶಸ್ವಿಯಾಗಿ ರದ್ದುಗೊಳಿಸಲಾಗಿದೆ! ದಯವಿಟ್ಟು ನಿಮ್ಮ ಮರುಹೊಂದಾಣಿಕೆಯ ಕಾರಣವನ್ನು ಆಯ್ಕೆಮಾಡಿ ದಯವಿಟ್ಟು ನಿಮ್ಮ ರದ್ದತಿ ಕಾರಣವನ್ನು ಆಯ್ಕೆಮಾಡಿ ವೈದ್ಯರು ಲಭ್ಯವಿಲ್ಲ ರೋಗಿಯು ಲಭ್ಯವಿಲ್ಲ ಇತರೆ ದಯವಿಟ್ಟು ಕಾರಣದ ವಿವರಗಳನ್ನು ನಮೂದಿಸಿ ಉಳಿಸಿ ಮತ್ತು ಮುಂದುವರೆಯಿರಿ ದಯವಿಟ್ಟು ಕಾರಣವನ್ನು ನಮೂದಿಸಿ!
ಮನೆಯ ರಚನೆಯ ಪ್ರಕಾರ ಕುಚಾ ಪಕ್ಕಾ ಮನೆಯ ಮುಖ್ಯಸ್ಥನ ಹೆಸರು ಧರ್ಮ ಹಿಂದೂ ಮುಸ್ಲಿಂ ಕ್ರಿಶ್ಚಿಯನ್ ಸಿಖ್ ಬೌದ್ಧ ಅಥವಾ ನವ-ಬೌದ್ಧ ಜೈನ್ ಯಹೂದಿ ಪಾರ್ಸಿ ಅಥವಾ ಜೊರಾಸ್ಟ್ರಿಯನ್ ಧರ್ಮವಿಲ್ಲ
ಪರಿಶಿಷ್ಟ ಜಾತಿ ಪರಿಶಿಷ್ಟ ಪಂಗಡ ಇತರೆ ಹಿಂದುಳಿದ ಜಾತಿ (ಒಬಿಸಿ) ಸಾಮಾನ್ಯ ಮನೆಯಲ್ಲಿ ಸ್ಮಾರ್ಟ್‌ಫೋನ್‌ಗಳ ಸಂಖ್ಯೆ ಮನೆಯಲ್ಲಿರುವ ಫೀಚರ್ ಫೋನ್‌ಗಳ ಸಂಖ್ಯೆ ಮನೆಯಲ್ಲಿರುವ ಸದಸ್ಯರನ್ನು ಗಳಿಸುವ ಸಂಖ್ಯೆ ಆದಾಯದ ಪ್ರಾಥಮಿಕ ಮೂಲ ಏಕದಳ ಉತ್ಪಾದನೆ (ಗೋಧಿ, ಜೋಳ, ಬಾರ್ಲಿ), ನಗದು ಬೆಳೆಗಳು (ಹತ್ತಿ, ಕಬ್ಬು, ಸೆಣಬು) ಅಥವಾ ತರಕಾರಿಗಳು ಮತ್ತು ಹಣ್ಣುಗಳ ಮಾರಾಟ ಪ್ರಾಣಿಗಳು ಅಥವಾ ಪ್ರಾಣಿ ಉತ್ಪನ್ನಗಳ ಮಾರಾಟ ಕೃಷಿ ಕೂಲಿ ಕಾರ್ಮಿಕರು (ಕೃಷಿ ಕೆಲಸಕ್ಕಾಗಿ ನೇಮಕ) ಸಂಬಳದ ಕೆಲಸಗಾರ (ನಿಗದಿತ ಮಾಸಿಕ ಸಂಬಳ) - ಸರ್ಕಾರಿ, ಖಾಸಗಿ, ಇತ್ಯಾದಿ ಸ್ವಯಂ ಉದ್ಯೋಗಿ (ಕೃಷಿಯೇತರ ಅಥವಾ ಸಣ್ಣ ವ್ಯಾಪಾರ) ದೈನಂದಿನ ಕೆಲಸ (ಕೌಶಲ್ಯವಿಲ್ಲದ ಕೆಲಸ- ಕೃಷಿ ಅಥವಾ ಕೃಷಿಯೇತರ) ಎನ್ ಆರ್ ಇ ಜಿ ಎ ಕಾಲೋಚಿತ ಕಾರ್ಮಿಕ ಕೂಲಿ ಕೆಲಸವಿಲ್ಲ ಪಿಂಚಣಿ ರವಾನೆಗಳು ಆದಾಯದ ಇತರ ಮೂಲ (ದಯವಿಟ್ಟು ನಿರ್ದಿಷ್ಟಪಡಿಸಿ) ಹೌದು ಅಲ್ಲ ಮನೆಗೆ ವಿದ್ಯುತ್ ಇದೆಯೇ? ದಿನಕ್ಕೆ ಗಂಟೆಗಳ ಸಂಖ್ಯೆ ವಾರಕ್ಕೆ ದಿನಗಳ ಸಂಖ್ಯೆ ಲೋಡ್ ಶೆಡ್ಡಿಂಗ್ ಮನೆಯಲ್ಲಿ ಶೌಚಾಲಯವಿದೆಯೇ? ಮನೆಯಲ್ಲಿ ಹರಿಯುವ ನೀರು ಲಭ್ಯವಿದೆಯೇ? ನೀರಿನ ಪೂರೈಕೆಯ ಲಭ್ಯತೆ ಮನೆಯವರಿಗೆ ಬ್ಯಾಂಕ್ ಖಾತೆ ಇದೆಯೇ? ಮನೆಯ ಮಾಲೀಕತ್ವದ ಕೃಷಿಯೋಗ್ಯ ಭೂಮಿಯ ಪ್ರಮಾಣ 0 – 1 1 – 2 2 – 5 5 – 10 10 ಕ್ಕಿಂತ ಹೆಚ್ಚು ಘಟಕಗಳು ಬಿಘಾ ಎಕರೆ ಗುಂಟಾ ಹೆಕ್ಟೇರ್ ಸರಾಸರಿ ವಾರ್ಷಿಕ ಮನೆಯ ಆದಾಯ (ಐಎನ್ ಆರ್) 0 – 30,000 30,000 – 50,000 50,000 – 1,00,000 1,00,000 – 2,50,000 2,50,000 ಕ್ಕಿಂತ ಹೆಚ್ಚು ಆರೋಗ್ಯದ ಮೇಲೆ ಸರಾಸರಿ ವೆಚ್ಚ 0 – 3,000 1 – 3,000 3,000 – 5,000 5,000 – 10,000 10,000 – 25,000 25,000 ಕ್ಕಿಂತ ಹೆಚ್ಚು ಶಿಕ್ಷಣಕ್ಕಾಗಿ ವಾರ್ಷಿಕ ಖರ್ಚು ಹಿಂದಿನ
ಉಪ-ಕೇಂದ್ರಕ್ಕೆ ದೂರ (ವಾಕಿಂಗ್ ಸಮಯದಲ್ಲಿ)* 5 ನಿಮಿಷಗಳಲ್ಲಿ 5-15 ನಿಮಿಷಗಳು 15-30 ನಿಮಿಷಗಳು 30 ನಿಮಿಷಗಳಿಗಿಂತ ಹೆಚ್ಚು 1 ಕಿಮೀ ಒಳಗೆ 1 - 3 ಕಿ.ಮೀ 3 - 5 ಕಿ.ಮೀ 5 ಕಿಮೀ ಗಿಂತ ಹೆಚ್ಚು ಹತ್ತಿರದ ಪ್ರಾಥಮಿಕ ಆರೋಗ್ಯ ಕೇಂದ್ರಗಳಿಗೆ ದೂರ (ಇನ್ ಕೆ ಎಮ್ ಎಸ್)* ಹತ್ತಿರದ ಸಮುದಾಯ ಆರೋಗ್ಯ ಕೇಂದ್ರಗಳಿಗೆ ದೂರ* 3 ಕಿಮೀ ಒಳಗೆ 3 - 6 ಕಿ.ಮೀ 10 ಕ್ಕೂ ಹೆಚ್ಚು ಕಿ.ಮೀ ಹತ್ತಿರದ ಜಿಲ್ಲಾ ಆಸ್ಪತ್ರೆಗೆ ದೂರ* 6 – 10 ಕಿ.ಮೀ 5 ಕಿಮೀ ಒಳಗೆ 5 – 10 ಕಿ.ಮೀ 10 – 20 ಕಿ.ಮೀ 20 – 30 ಕಿ.ಮೀ 30 ಕ್ಕೂ ಹೆಚ್ಚು ಕಿ.ಮೀ ಹತ್ತಿರದ ಮೆಡಿಕಲ್ ಸ್ಟೋರ್‌ಗೆ ದೂರ* ಹತ್ತಿರದ ರೋಗಶಾಸ್ತ್ರೀಯ ಪ್ರಯೋಗಾಲಯಕ್ಕೆ ದೂರ* ಹತ್ತಿರದ ಖಾಸಗಿ ಕ್ಲಿನಿಕ್‌ಗೆ ದೂರ (ಎಮ್ ಬಿ ಬಿ ಎಸ್ ವೈದ್ಯರೊಂದಿಗೆ)* ಹತ್ತಿರದ ಖಾಸಗಿ ಕ್ಲಿನಿಕ್‌ಗೆ ದೂರ (ಪರ್ಯಾಯ ವೈದ್ಯಕೀಯ ವೈದ್ಯರೊಂದಿಗೆ - ಬಿ ಎ ಎಮ್ ಎಸ್, ಬಿ ಎಚ್ ಎಮ್ ಎಸ್, ಆಯುರ್ವೇದ ಇತ್ಯಾದಿ)* ಈ ಮನೆಯ ಯಾವುದೇ ಸದಸ್ಯರು ಬ್ಯಾಂಕ್ ಖಾತೆ ಅಥವಾ ಪೋಸ್ಟ್-ಆಫೀಸ್ ಖಾತೆಯನ್ನು ಹೊಂದಿದ್ದಾರೆಯೇ? ಗೊತ್ತಿಲ್ಲ ಈ ಮನೆಯಲ್ಲಿ ಬಿ ಪಿ ಎಲ್ ಕಾರ್ಡ್/ಕೂಪನ್ ಇದೆಯೇ? ಹೌದು, ಕಾರ್ಡ್ ನೋಡಿದೆ ಹೌದು, ಕಾರ್ಡ್ ನೋಡಿಲ್ಲ ಕಾರ್ಡ್ ಇಲ್ಲ ಈ ಮನೆಯವರು ಅಂತೋದಯ ಕಾರ್ಡ್/ಕೂಪನ್ ಹೊಂದಿದೆಯೇ? ಈ ಮನೆಯು ರಾಷ್ಟ್ರೀಯ ಸ್ವಾಸ್ತ್ ಬಿಮಾ ಯೋಜನೆ (ಆರ್ ಎಸ್ ಬಿ ವೈ ಕಾರ್ಡ್ ಹೊಂದಿದೆಯೇ? ಈ ಮನೆಯವರು ಎಮ್ ಜಿ ಎನ್ ಆರ್ ಇ ಜಿ ಎ ಕಾರ್ಡ್ ಅನ್ನು ಹೊಂದಿದ್ದಾರೆಯೇ?* ಸಲ್ಲಿಸು ನಿಮ್ಮ ಮನೆಯವರು ಯಾವ ರೀತಿಯ ಇಂಧನವನ್ನು ಮುಖ್ಯವಾಗಿ ಅಡುಗೆಗೆ ಬಳಸುತ್ತಾರೆ? ವಿದ್ಯುತ್ ಎಲ್ ಪಿ ಜಿ ಅಥವಾ ನೈಸರ್ಗಿಕ ಅನಿಲ ಜೈವಿಕ ಅನಿಲ ಸೀಮೆಎಣ್ಣೆ ಕಲ್ಲಿದ್ದಲು ಅಥವಾ ಲಿಗ್ನೈಟ್ ಮರ ಇದ್ದಿಲು ಹುಲ್ಲು ಅಥವಾ ಪೊದೆಗಳು ಅಥವಾ ಹುಲ್ಲು ಕೃಷಿ ಬೆಳೆ ತ್ಯಾಜ್ಯ ಸಗಣಿ ಕೇಕ್ ಇತರೆ (ನಿರ್ದಿಷ್ಟಪಡಿಸಿ) ಈ ಮನೆಯಲ್ಲಿ ಬೆಳಕಿನ ಮುಖ್ಯ ಮೂಲ ಯಾವುದು? ಲ್ಯಾಂಟರ್ನ್ / ಸೀಮೆಎಣ್ಣೆ ದೀಪ / ಮೋಂಬತ್ತಿ ಸೀಮೆಎಣ್ಣೆ ದೀಪ ಮೋಂಬತ್ತಿ ಎಲೆಕ್ಟ್ರಿಕ್ ಎಲ್.ಪಿ.ಜಿ ಸೌರಶಕ್ತಿ ಯಾವುದೂ ಇಲ್ಲ ವಾಸಕ್ಕೆ ಪೈಪ್ ಹಾಕಲಾಗಿದೆ ಯಾರ್ಡ್ ಅಥವಾ ಪ್ಲಾಟ್‌ಗೆ ಪೈಪ್ ಹಾಕಲಾಗಿದೆ ಸಾರ್ವಜನಿಕ ಟ್ಯಾಪ್ ಅಥವಾ ಸ್ಟ್ಯಾಂಡ್ ಪೈಪ್ ಕೊಳವೆ ಬಾವಿ ಅಥವಾ ಕೊಳವೆಬಾವಿ ಚೆನ್ನಾಗಿ ರಕ್ಷಿಸಲಾಗಿದೆ ರಕ್ಷಣೆಯಿಲ್ಲದ ಬಾವಿ ರಕ್ಷಿತ ವಸಂತ ಅಸುರಕ್ಷಿತ ವಸಂತ ಮಳೆನೀರು ಟ್ಯಾಂಕರ್ ಟ್ರಕ್ ಸಣ್ಣ ಟ್ರಕ್ ಜೊತೆ ಕಾರ್ಟ್ ಮೇಲ್ಮೈ ನೀರು ಸಾಮಾನ್ಯ ಕೈ ಪಂಪ್ ಮನೆಯಲ್ಲಿ ಕೈ ಪಂಪ್ ನಿಮ್ಮ ಮನೆಯ ಸದಸ್ಯರಿಗೆ ಕುಡಿಯುವ ನೀರಿನ ಮುಖ್ಯ ಮೂಲ ಯಾವುದು? ನಿಮ್ಮ ಮನೆಯಿಂದ ನೀರಿನ ಮೂಲದವರೆಗೆ ನಡೆಯಲು ಎಷ್ಟು ಸಮಯ ತೆಗೆದುಕೊಳ್ಳುತ್ತದೆ? ನಿಮಿಷಗಳ ಸಂಖ್ಯೆ ನಿಮ್ಮ ನೀರನ್ನು ಕುಡಿಯಲು ಸುರಕ್ಷಿತವಾಗಿಸಲು ನೀವು ಯಾವುದೇ ರೀತಿಯಲ್ಲಿ ಚಿಕಿತ್ಸೆ ನೀಡುತ್ತೀರಾ? ನೀರನ್ನು ಸುರಕ್ಷಿತವಾಗಿ ಕುಡಿಯಲು ನೀವು ಸಾಮಾನ್ಯವಾಗಿ ಏನು ಮಾಡುತ್ತೀರಿ? ಕುದಿಸಿ ಹರಳೆಣ್ಣೆ ಬಳಸಿ ಬ್ಲೀಚ್ ಸೇರಿಸಿ ಒಂದು ಬಟ್ಟೆಯ ಮೂಲಕ ಸ್ಟ್ರೈನ್ ಮಾಡಿ ವಾಟರ್ ಫಿಲ್ಟರ್ ಬಳಸಿ ಎಲೆಕ್ಟ್ರಾನಿಕ್ ಪ್ಯೂರಿಫೈಯರ್ ಬಳಸಿ ಲೆಟ್ ಇಟ್ ಸ್ಟ್ಯಾಂಡ್ ಅಂಡ್ ಸೆಟಲ್ ಪೈಪ್ಡ್ ಒಳಚರಂಡಿ ವ್ಯವಸ್ಥೆಗೆ ಫ್ಲಶ್ ಮಾಡಿ ಸೆಪ್ಟಿಕ್ ಟ್ಯಾಂಕ್‌ಗೆ ಫ್ಲಶ್ ಮಾಡಿ ಪಿಟ್ ಲ್ಯಾಟ್ರಿನ್‌ಗೆ ಫ್ಲಶ್ ಮಾಡಿ ಬೇರೆಡೆಗೆ ಫ್ಲಶ್ ಮಾಡಿ ಫ್ಲಶ್, ಎಲ್ಲಿ ಗೊತ್ತಿಲ್ಲ ವೆಂಟಿಲೇಟೆಡ್ ಇಂಪ್ರೂವ್ಡ್ ಪಿಟ್ (ವಿಐಪಿ) ಅಥವಾ ಬಯೋಗ್ಯಾಸ್ ಲ್ಯಾಟ್ರಿನ್ ಚಪ್ಪಡಿಯೊಂದಿಗೆ ಪಿಟ್ ಲ್ಯಾಟ್ರಿನ್ ಚಪ್ಪಡಿ ಅಥವಾ ಓಪನ್ ಪಿಟ್ ಇಲ್ಲದ ಪಿಟ್ ಲ್ಯಾಟ್ರಿನ್ ಟ್ವಿನ್ ಪಿಟ್ ಅಥವಾ ಕಾಂಪೋಸ್ಟಿಂಗ್ ಟಾಯ್ಲೆಟ್ ಡ್ರೈ ಟಾಯ್ಲೆಟ್ ಯಾವುದೇ ಸೌಲಭ್ಯವಿಲ್ಲ ಅಥವಾ ತೆರೆದ ಸ್ಥಳ ಅಥವಾ ಕ್ಷೇತ್ರವನ್ನು ಬಳಸುವುದಿಲ್ಲ ಕಳೆದ ವಾರದಲ್ಲಿ ನಿಮ್ಮ ಮನೆಯಲ್ಲಿ ಯಾರಾದರೂ (ಮಕ್ಕಳೂ ಸೇರಿದಂತೆ) ಯಾವುದೇ ಕಾರಣದಿಂದ ಬಯಲಿನಲ್ಲಿ ಮಲವಿಸರ್ಜನೆ ಮಾಡಬೇಕಾಗಿ ಬಂದಿದೆಯೇ? ನೀವು ತೆರೆದ ಸ್ಥಳದಲ್ಲಿ ನಿಮ್ಮನ್ನು ನಿವಾರಿಸಲು ಮುಖ್ಯ ಕಾರಣವೇನು? ಶೌಚಾಲಯದಲ್ಲಿ ನೀರು ಲಭ್ಯವಿಲ್ಲ ಶೌಚಾಲಯದಲ್ಲಿ ವಿದ್ಯುತ್ ಲಭ್ಯವಿಲ್ಲ ಶೌಚಾಲಯವನ್ನು ಸಾಮಾನ್ಯವಾಗಿ ಇತರ ಸದಸ್ಯರು ಆಕ್ರಮಿಸಿಕೊಂಡಿರುತ್ತಾರೆ ಟಾಯ್ಲೆಟ್ ಕೊಳಾಯಿಯಲ್ಲಿ ಸಮಸ್ಯೆ ಇತರ ಕಾರಣಗಳು (ನಿರ್ದಿಷ್ಟಪಡಿಸಿ) ನಿನ್ನೆ ಈ ಸಮಯದಿಂದ ನೀವು ಯಾವ ಸಂದರ್ಭಗಳಲ್ಲಿ ಸಾಬೂನಿನಿಂದ ನಿಮ್ಮ ಕೈಗಳನ್ನು ತೊಳೆದುಕೊಂಡಿದ್ದೀರಿ? ಮನೆಯಲ್ಲಿ ಸೋಪ್ ಲಭ್ಯವಿಲ್ಲ ಮನೆಯಲ್ಲಿ ಸೋಪ್ ಲಭ್ಯವಿದ್ದರೂ ಕೈ ತೊಳೆಯಲು ಬಳಸುತ್ತಿರಲಿಲ್ಲ ಅಡುಗೆ ಮಾಡುವ ಮೊದಲು ಆಹಾರವನ್ನು ನಿರ್ವಹಿಸಿದ ನಂತರ ತಿನ್ನುವ ಮೊದಲು ಶೌಚಾಲಯವನ್ನು ಬಳಸಿದ ನಂತರ ನಿಮ್ಮ ಮನೆಯಲ್ಲಿ ಕಳೆದ ೨೪ ಗಂಟೆಗಳಲ್ಲಿ ಯಾವ ರೀತಿಯ ಆಹಾರ ಪದಾರ್ಥಗಳನ್ನು ಬೇಯಿಸಲಾಗಿದೆ/ತಯಾರಿಸಲಾಗಿದೆ? ಪಿಷ್ಟದ ಪ್ರಧಾನ ಆಹಾರ (ಅಕ್ಕಿ, ರೊಟ್ಟಿ, ಬ್ರೆಡ್, ಒತ್ತಿದ ಅಕ್ಕಿ, ಮುರಿ, ಆಲೂಗಡ್ಡೆ, ಸಿಹಿ ಗೆಣಸು, ಅರ್ಬಿ, ಮರಗೆಣಸು, ಬಾಳೆಹಣ್ಣು, ಯಾವುದೇ ಇತರ ಬೇರುಗಳು ಮತ್ತು ಗೆಡ್ಡೆಗಳು, ನೂಡಲ್ಸ್, ಪಾಸ್ತ) ಬೀನ್ಸ್ ಮತ್ತು ಅವರೆಕಾಳು (ಬೀನ್ಸ್, ಬಟಾಣಿ, ಮೂಂಗ್ ದಾಲ್, ಚನ್ನ ದಾಲ್, ಅರಹರ್ ದಾಲ್, ಉರಾದ್ ದಾಲ್, ಕಿಡ್ನಿ ಬೀನ್ಸ್, ಮ್ಯಾಟರ್ ದಾಲ್, ಇತರ ಬೇಳೆಕಾಳುಗಳು ಮತ್ತು ಸೋಯಾಬೀನ್, ಸೀಮ್, ಸಾಸಿವೆ) ಬೀಜಗಳು ಮತ್ತು ಚೀಸ್, ನೆಲಗಡಲೆ, ಏಪ್ರಿಕಾಟ್, ಬಾದಾಮಿ, ಪಿಸ್ತಾ, ತೆಂಗಿನಕಾಯಿ, ಸೀಸಮ್ ಬೀಜ, ಕಮಲದ ಬೀಜ, ಹಲಸಿನ ಬೀಜ, ಗೋಡಂಬಿ, ಅಡಿಕೆ, ಸಾಸಿವೆ ಬೀಜ, ಸೂರ್ಯಕಾಂತಿ ಬೀಜ, ಕುಂಬಳಕಾಯಿ ಬೀಜಗಳು) ಡೈರಿ (ಹಾಲು - ಹಸು ಅಥವಾ ಮೇಕೆ ಅಥವಾ ಎಮ್ಮೆ, ಪೌಡರ್ ಹಾಲು, ಲಿಕ್ವಿಡ್ ಪ್ಯಾಕೆಟ್ ಹಾಲು, ಮೊಸರು, ಪನೀರ್, ಸೇವಾಯಿ, ಖೀರ್, ಸಿಹಿತಿಂಡಿಗಳು, ಬೆಣ್ಣೆ, ತುಪ್ಪ) ಮೊಟ್ಟೆಗಳು ಮಾಂಸ ಆಹಾರ (ಮಾಂಸ, ಕೋಳಿ, ಮೀನು ಇತ್ಯಾದಿ) ಯಾವುದೇ ತರಕಾರಿಗಳು ಉಳಿಸಲಾಗಿದೆ ಸಮೀಕ್ಷೆಯನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಸೇರಿಸಲಾಗಿದೆ ಮನೆಯ ಸಮೀಕ್ಷೆಯನ್ನು ಪ್ರಾರಂಭಿಸಿ ಮನೆಯ ಮುಖ್ಯಸ್ಥರೊಂದಿಗೆ ನಿಮ್ಮ ಸಂಬಂಧವೇನು?*
ಸಂಗಾತಿಯ ಮಗ ಅಥವಾ ಮಗಳು ಮಗ ಅಥವಾ ಸೊಸೆ ಮೊಮ್ಮಗ ತಂದೆ ಅಥವಾ ತಾಯಿ ಮಾವ ಅಥವಾ ಅತ್ತೆ ಸಹೋದರ ಅಥವಾ ಸಹೋದರಿ ಸೋದರ ಅಥವಾ ಅತ್ತಿಗೆ ಸೊಸೆ ಅಥವಾ ಸೋದರಳಿಯ ಅಜ್ಜ ಅಥವಾ ಅಜ್ಜ-ಅಜ್ಜಿ ಅನ್ಯ ಸಂಬಂಧಿ ದತ್ತು ಅಥವಾ ಪೋಷಕ ಅಥವಾ ಮಲಮಗು ಗೃಹ ಸೇವಕ ಇತರೆ ಸಂಬಂಧವಿಲ್ಲ ಹೇಳಿಲ್ಲ
ನಿಮ್ಮ ವೈವಾಹಿಕ ಸ್ಥಿತಿ ಏನು?* ಪ್ರಸ್ತುತ ವಿವಾಹಿತರು
ವಿವಾಹಿತರು ಅವಿವಾಹಿತ ವಿಧವೆಯಾದ ವಿಚ್ಛೇದನ ಪಡೆದಿದ್ದಾರೆ ಬೇರ್ಪಡಿಸಲಾಗಿದೆ ಮರಳುಭೂಮಿಯ ಅವಿವಾಹಿತ
ಓದಲು ಅಥವಾ ಬರೆಯಲು ಬರುವುದಿಲ್ಲ ಓದಲು ಮತ್ತು ಬರೆಯಲು ಸಾಧ್ಯವಾಗುತ್ತದೆ ಪ್ರಾಥಮಿಕ ಶಿಕ್ಷಣ (5 ನೇ ತರಗತಿಯವರೆಗೆ) ಮಧ್ಯಮ ಶಾಲೆ ( 6ನೇ - 8ನೇ) ಮಾಧ್ಯಮಿಕ ಶಾಲೆಯಲ್ಲಿ ಉತ್ತೀರ್ಣರಾಗಿದ್ದಾರೆ (10 ನೇ ತರಗತಿ ಬೋರ್ಡ್‌ಗಳು) ಹಿರಿಯ ಮಾಧ್ಯಮಿಕ ಶಾಲೆಯಲ್ಲಿ ಉತ್ತೀರ್ಣರಾಗಿದ್ದಾರೆ (12 ನೇ ತರಗತಿ ಮಂಡಳಿಗಳು) ಪದವಿಧರ ಸಂಬಳದ ಸರ್ಕಾರಿ ಕೆಲಸ ಪದವಿ ಮತ್ತು ಮೇಲ್ಪಟ್ಟವರು
ಸಂಬಳದ ಸರ್ಕಾರಿ ಕೆಲಸ ಸಂಬಳದ ಖಾಸಗಿ ಕೆಲಸ ಸಣ್ಣ ವ್ಯಾಪಾರ ಅಥವಾ ಅಂಗಡಿ ಮಾಲೀಕರು ತಂತ್ರಜ್ಞ ಅಥವಾ ಕುಶಲಕರ್ಮಿ ಅಥವಾ ಇತರ ನುರಿತ ಕೆಲಸ (ಚಾಲಕ, ಮೇಸನ್, ಇತ್ಯಾದಿ) ಕೃಷಿ ರೈತ ಗೇಣಿದಾರ ರೈತ ಅಥವಾ ಕೃಷಿ ದೈನಂದಿನ ಕೂಲಿ ಕೆಲಸಗಾರ ದಿನಗೂಲಿ ಕೆಲಸಗಾರ (ಕೌಶಲ್ಯವಿಲ್ಲದ ಕೆಲಸಗಾರ) ಮನೆಯ ಕೆಲಸ ವಿದ್ಯಾರ್ಥಿ ನಿರುದ್ಯೋಗಿ ನಿವೃತ್ತಿ (ಪಿಂಚಣಿಯೊಂದಿಗೆ) ನಿವೃತ್ತಿ (ಪಿಂಚಣಿ ಇಲ್ಲದೆ) ಅನ್ವಯಿಸುವುದಿಲ್ಲ
ಹಂಚಿಕೊಂಡಿದ್ದಾರೆ ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಹೊಂದಿದ್ದಾರೆ ಫೀಚರ್ ಫೋನ್ ಅನ್ನು ಹೊಂದಿದೆ
ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಹೊಂದಿದ್ದಾರೆ ಫೀಚರ್ ಫೋನ್ ಅನ್ನು ಹೊಂದಿದೆ ಹಂಚಿದ ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಹಂಚಿದ ವೈಶಿಷ್ಟ್ಯ ಫೋನ್
ಹೌದು (ಕುಟುಂಬದ ಸದಸ್ಯ) ಹೌದು (ವೈಯಕ್ತಿಕ)
ನಿಮ್ಮ ಬಿಪಿಯನ್ನು ನೀವು ಕೊನೆಯ ಬಾರಿ ಯಾವಾಗ ಪರಿಶೀಲಿಸಿದ್ದೀರಿ?* ನಿಮ್ಮ ಸಕ್ಕರೆ ಮಟ್ಟವನ್ನು ನೀವು ಕೊನೆಯ ಬಾರಿ ಪರಿಶೀಲಿಸಿದ್ದು ಯಾವಾಗ?* ನಿಮ್ಮ ಎಚ್ ಬಿ ಮಟ್ಟವನ್ನು ನೀವು ಕೊನೆಯ ಬಾರಿ ಪರಿಶೀಲಿಸಿದ್ದು ಯಾವಾಗ?* ನಿಮ್ಮ ಬಿ ಎಮ್ ಐ (ಎತ್ತರ ಮತ್ತು ತೂಕ) ಅನ್ನು ಕೊನೆಯ ಬಾರಿ ಯಾವಾಗ ಪರಿಶೀಲಿಸಲಾಯಿತು?*
ಎಂದಿಗೂ ಪರಿಶೀಲಿಸಲಾಗಿಲ್ಲ ಕಳೆದ ಒಂದು ವಾರದಲ್ಲಿ ಕಳೆದ 6 ತಿಂಗಳೊಳಗೆ ಒಂದು ತಿಂಗಳಿಂದ 3 ತಿಂಗಳ ಹಿಂದೆ 3 ತಿಂಗಳಿಂದ 6 ತಿಂಗಳ ಹಿಂದೆ 6 ತಿಂಗಳಿಗಿಂತ ಹೆಚ್ಚು
ಇತರ ವೈದ್ಯಕೀಯ ಇತಿಹಾಸ* ಅಧಿಕ ರಕ್ತದೊತ್ತಡ ಮಧುಮೇಹ* ಸಂಧಿವಾತ* ರಕ್ತಹೀನತೆ* ಯಾವುದೇ ಶಸ್ತ್ರಚಿಕಿತ್ಸೆಗಳು?* ಶಸ್ತ್ರಚಿಕಿತ್ಸೆಗೆ ಕಾರಣ (ಕಾರಣವನ್ನು ಸೂಚಿಸಿ)*
ಧೂಮಪಾನ ಸ್ಥಿತಿ* ವ್ಯಕ್ತಿಯು ಧೂಮಪಾನ ಮಾಡುತ್ತಾರೆಯೇ? ಧೂಮಪಾನಿ ಧೂಮಪಾನ ಮಾಡದವ 5-10 ಬೀಡಿಗಳು / ಸಿಗರೇಟ್ 10 ಕ್ಕಿಂತ ಹೆಚ್ಚು ಬೀಡಿ / ಸಿಗರೇಟ್ ಧೂಮಪಾನದ ದರ ನೀವು ಎಷ್ಟು ಸಮಯದಿಂದ ಧೂಮಪಾನ ಮಾಡುತ್ತಿದ್ದೀರಿ ಒಂದು ವರ್ಷಕ್ಕಿಂತ ಕಡಿಮೆ 1 ವರ್ಷದಿಂದ 5 ವರ್ಷಗಳವರೆಗೆ 5 ರಿಂದ 10 ವರ್ಷಗಳವರೆಗೆ 10 ವರ್ಷಗಳಿಗಿಂತ ಹೆಚ್ಚು
ಆಲ್ಕೊಹಾಲ್ ಸೇವನೆಯ ಇತಿಹಾಸ* ಮನೆಯಲ್ಲಿ ಆಲ್ಕೊಹಾಲ್ ಸೇವನೆಯ ಇತಿಹಾಸವಿದೆಯೇ? ಇಲ್ಲ ಅಥವಾ ನಿರಾಕರಿಸಲಾಗಿದೆ ಆಲ್ಕೋಹಾಲ್ ಸೇವನೆಯ ದರ 0 – 5 ಬಾರಿ 5 – 10 ಬಾರಿ 10 ಕ್ಕಿಂತ ಹೆಚ್ಚು ಬಾರಿ ನೀವು ಎಷ್ಟು ಸಮಯದಿಂದ ಮದ್ಯ ಸೇವಿಸುತ್ತಿದ್ದೀರಿ? ತಿದ್ದು ಅಳಿಸಿ
ಎಲ್ಲಾ ಕ್ಷೇತ್ರಗಳು ಕಡ್ಡಾಯವಾಗಿವೆ ದಯವಿಟ್ಟು ಅಗತ್ಯವಿರುವ ಎಲ್ಲಾ ಕ್ಷೇತ್ರಗಳನ್ನು ಭರ್ತಿ ಮಾಡಿ ವೈದ್ಯಕೀಯ ಇತಿಹಾಸವು ಖಾಲಿಯಾಗುವುದಿಲ್ಲ ಧೂಮಪಾನದ ಇತಿಹಾಸವು ಖಾಲಿಯಾಗುವುದಿಲ್ಲ ಆಲ್ಕೋಹಾಲ್ ಸೇವನೆಯ ಇತಿಹಾಸವು ಖಾಲಿಯಾಗುವುದಿಲ್ಲ ಜಲ ಜೀವನ್ ಯೋಜನೆ ಅಡಿಯಲ್ಲಿ ಗ್ರಾಮಕ್ಕೆ ನೀರು ಸಿಗುತ್ತದೆಯೇ? ನಲ್ ಜಲ ಯೋಜನೆ ನಿಮ್ಮ ಕುಟುಂಬವು ಎಷ್ಟು ಕೃಷಿಯೋಗ್ಯ ಭೂಮಿಯನ್ನು ಹೊಂದಿದೆ? ಬಿಪಿ* ೫ ಬೀಡಿ/ಸಿಗರೇಟ್‌ಗಳಿಗಿಂತ ಕಡಿಮೆ ಉತ್ತರಿಸಲು ನಿರಾಕರಿಸಲಾಗಿದೆ ಉತ್ತರಿಸಲು ನಿರಾಕರಿಸಲಾಗಿದೆ ಬಳಕೆಯ ಆವರ್ತನ ಪ್ರತಿದಿನ ವಾರಕ್ಕೆ ಒಂದು ಸಲ ವಾರಕ್ಕೆ ಎರಡು ಬಾರಿ ಸಾಂದರ್ಭಿಕವಾಗಿ (ತಿಂಗಳಿಗೊಮ್ಮೆ ಅಥವಾ ಕಡಿಮೆ)
ನೀವು ಕುಟುಂಬದ ಮುಖ್ಯಸ್ಥರಾಗಿದ್ದರೆ ದಯವಿಟ್ಟು ತಿಳಿಸಿ ವಾಸಿಸುವ ಸದಸ್ಯರ ಸಂಖ್ಯೆಯು ಮನೆಯಲ್ಲಿರುವ ಒಟ್ಟು ಸದಸ್ಯರ ಸಂಖ್ಯೆಗಿಂತ ಹೆಚ್ಚಿರಬಾರದು ದಯವಿಟ್ಟು ಕುಡಿಯುವ ನೀರಿನ ಮುಖ್ಯ ಮೂಲವನ್ನು ಆಯ್ಕೆಮಾಡಿ ದಯವಿಟ್ಟು ನೀರನ್ನು ಶುದ್ಧೀಕರಿಸುವ ವಿಧಾನಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ ನಿಮ್ಮ ಮನೆಯಲ್ಲಿ ಹರಿಯುವ ನೀರು ಇದ್ದರೆ ದಯವಿಟ್ಟು ತಿಳಿಸಿ ಗಂಟೆಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ ನಿಮ್ಮ ಮನೆಯಲ್ಲಿ ವಿದ್ಯುತ್ ಇದ್ದರೆ ದಯವಿಟ್ಟು ತಿಳಿಸಿ ಖರ್ಚಿಲ್ಲ ಈ ಮನೆಯವರು ಆಯುಷ್ಮಾನ್ ಕಾರ್ಡ್ ಹೊಂದಿದ್ದಾರೆಯೇ?* ಈ ಮನೆಯವರು ಪಡಿತರ ಚೀಟಿ ಹೊಂದಿದ್ದಾರೆಯೇ?*
